function suggest(class_id,text){$.ajax({url:g_sges+encodeURIComponent(text),cache:!0,dataType:"jsonp",async:!0,crossDomain:!0,method:"GET",headers:{"accept":"application/json",'Access-Control-Allow-Origin':'https://suggestqueries.google.com,https://www.youtube.com'},success:function(data){$.each(data[1],function(key,value){var url=baseURL+'download/'+value.replace(/[`~!@#$%^&*()_|+\-=?;:'",.<>\{\}\[\]\\\/]/gi,'').replace(/\s\s+/g,' ').split(' ').join('-');var text='<a class="list-group-item text-dark" href="'+url+'">'+value+'</a>';$(class_id).append(text)})}})}
$(document).ready(function(){function c(){var c=$("#search_music").val();c=c.replace(/[^a-zA-Z0-9]/g,'-').replace(/-{2,}/g,'-'),window.location=baseURL+"download/"+c}
$(document).on("click",".go_search_music",function(){c()}),$(document).on("keypress","#search_music",function(n){13==n.which&&c()})
$(window).scroll(function(){if($(this).scrollTop()>100){$('#scroll-to-top').fadeIn()}else{$('#scroll-to-top').fadeOut()}});$('#scroll-to-top').click(function(){$('#scroll-to-top').tooltip('hide');$('body,html').animate({scrollTop:0},800);return!1})})
